	static constexpr std::string_view s_characters =
		"abcdefghijklmnopqrstuvwxyz"
		"ABCDEFGHIJKLMNOPQRSTUVWXYZ"
		"0123456789"
		"!@#\$%^&*\(\)-=_\+\[\]\{\}\|;':\",.<>/?\\`~"
		" ";

	static auto load_font_from_memory(const void* data, const std::size_t size)
	{

		static constexpr std::uint32_t s_max_size = 1024;

		struct code_point_info
		{
			// font data
			std::int32_t width{};
			std::int32_t height{};
			std::int32_t xoff{};
			std::int32_t yoff{};
			char character{};
			std::uint8_t* pixels{ nullptr };


			// texture info
			vec2f uv_top_left{};
			vec2f uv_bottom_right{};
			vec2f size{};
			vec2f offset{};
			float advance{};

		};

		// Collect code points
		std::vector<code_point_info> code_points;

		stbtt_fontinfo font_info;
		stbtt_InitFont(&font_info, static_cast<const unsigned char*>(data), 0);

		int32_t ascent, descent, line_gap;
		const auto scale = stbtt_ScaleForPixelHeight(&font_info, font::sample_size);

		stbtt_GetFontVMetrics(&font_info, &ascent, &descent, &line_gap);

		for (const auto c : s_characters)
		{
			std::int32_t advance, left_side_bearing;
			code_point_info cp{ .character = c };

			stbtt_GetCodepointHMetrics(&font_info, c, &advance, &left_side_bearing);


			cp.pixels = stbtt_GetCodepointSDF(&font_info, scale, c, 5, 127, 3, &cp.width, &cp.height, &cp.xoff, &cp.yoff);
			// This fucking formula took forever (FUCK images with origin on the top left
			cp.offset = vec2f(cp.xoff,  -cp.yoff - cp.height) / font::sample_size;
			cp.size = { cp.width / font::sample_size, cp.height / font::sample_size };
			cp.advance = (scale * advance) / font::sample_size;
			code_points.push_back(std::move(cp));
		}


		// Sort by ascending height
		std::ranges::sort(code_points, std::less{}, [](const auto& v) { return v.height; });

		// Pack code points
		std::vector<std::uint8_t> atlas_data(s_max_size * s_max_size);
		std::unordered_map<char, font::code_point> code_points_map;
		std::uint32_t current_x = 0, current_y = 0;

		for (auto& cp : code_points)
		{
			if (current_x + cp.width > s_max_size)
			{
				current_x = 0;
				current_y += cp.height;
			}

			for (std::uint32_t y = 0; y < cp.height; ++y)
				for (std::uint32_t x = 0; x < cp.width; ++x)
					atlas_data[((y + current_y) * s_max_size) + current_x + x] = cp.pixels[(y * cp.width) + x];

			code_points_map[cp.character] = {
				.uv_top_left = { current_x / static_cast<float>(s_max_size), current_y / static_cast<float>(s_max_size) },
				.uv_bottom_right = { (current_x + cp.width) / static_cast<float>(s_max_size), (current_y + cp.height) / static_cast<float>(s_max_size) },
				.size = cp.size,
				.offset = cp.offset,
				.advance = cp.advance,
				.character = cp.character 
			};


			current_x += cp.width;
		}



		// Cleanup

		for (auto& cp : code_points)
			stbtt_FreeSDF(cp.pixels, nullptr);


		// Return result
		auto tex = texture2d::load(texture_format::r8, s_max_size, s_max_size, texture_filter_mode::linear_mipmap_linear, atlas_data.data());
		
		return std::tuple{
			std::move(code_points_map),
			std::move(tex),
			ascent * scale / font::sample_size,
			descent * scale / font::sample_size,
			line_gap * scale / font::sample_size
		};

	}


	font font::get_default_font()
	{
		font ret;
		ret.load_from_memory(s_emb_font.data(), s_emb_font.size());
		return ret;
	}

	void font::load_from_file(const std::string_view path)
	{
		std::ifstream is;

		// Read file data
		is.open(path.data(), std::ios_base::binary);

		if (!is.good())
			throw std::runtime_error("Failed to open font file");

		is.seekg(0, std::ios_base::end);
		auto file_size = is.tellg();
		std::vector<std::uint8_t> file_data(file_size);
		is.seekg(0);
		is.read(reinterpret_cast<char*>(file_data.data()), file_size);
		is.close();

		load_from_memory(file_data.data(), file_data.size());
	}

	void font::load_from_memory(const void* data, const std::size_t size)
	{
		auto [code_points, texture, ascent, descent, line_gap] = load_font_from_memory(data, size);
		_texture = std::move(texture);
		_code_points = std::move(code_points);
		_ascent = ascent;
		_descent = descent;
	}

	float font::get_string_width(const std::string_view str) const
	{
		float max_length = 0.0f;
		float curr_length = 0.0f;
		for (const auto c : str)
		{
			// Might be a new line (TODO: fix this shit)
			if (c == '\n')
				curr_length = 0.0f;
			else
				curr_length += _code_points.at(c).advance;

			max_length = std::max(max_length, curr_length);

		}
		return max_length;
	}

	std::string font::shrink_to_fit(const std::string_view str, const float max_width) const
	{

		static constexpr auto trim_right = [](std::string& s){
			if (const auto i = s.find_last_not_of(' '); i != std::string_view::npos)
				s.erase(s.begin() + i + 1, s.end());
		};

		std::string result{};
		float current_len = 0.0f;

		for (auto it = str.begin(); it != str.end();)
		{
			if (*it == '\n')
			{
				current_len = 0.0f;
				result.push_back('\n');
				++it;
			}
			else if (std::isspace(*it))
			{
				current_len += get_code_point(' ').advance;
				result.push_back(' ');
				++it;
			}
			else
			{
				auto beg = it;
				while (it != str.end() && !std::isspace(*it))
					++it;
				std::string_view word{ beg, it };
				const auto ww = get_string_width(word);

				if (current_len + ww > max_width)
				{
					// Erase trailing spaces and add a new line
					trim_right(result);
					result.push_back('\n');
					current_len = 0.0f;
				}

				result.append(word.begin(), word.end());
				current_len += ww;

			}
		}

		trim_right(result);

		return result;

	}

